import Todo from './components/Todo';

function App() {
  return (
    <div>
      <h1>My Todos</h1>
      <Todo title='Learn React'/>
      <Todo title='Explore React'/>
      <Todo title='Use React'/>
    </div>
  );
}

export default App;
